import { useRouter } from 'next/router';
import Layout from '../components/Layout';

const Post = () => {
  const router = useRouter();
  const data = JSON.parse(router.query.person)

  const {name, gender, hair_color, birth_year} = data;

  return (
    <Layout>
        <h1>{name}</h1>
        <h5>{gender}</h5>
    </Layout>
  );
};

export default Post;
